productsCountry.productName:
Медиагель 
Универсальный гель  предназначен  для ультразвуковых исследований, доплерографии и терапии. Вязкость: по Брукфильду 27,5 Па•c (соответствует вязкости 14,5 Па•c при скорости сдвига (16,8)c-1);
pH: 6,9

Шпатель 
Шпатель терапевтический деревянный, стерильный, длина  150 мм;
- ширина 18 мм; 
- толщина  1,8 мм. Каждый шпатель  упакован в индивидуальную стерильную упаковку.

Индикатор 
Индикатор химический контроля эффективности очистки изделий, предназначен для определения эффективности очистки изделий от щелочных моющих средств. 
В комплект поставки входят (шт.): 
банка полимерная с индикатором - 1; 
инструкция по применению - 1; 
упаковочная коробка или пакет - 1.

